import React, { Component } from "react";
import Footer from "./ApplicantPages/Footer";

export default class Root extends Component {
  render() {
    return (
      <div className="wrapper">
        <div className="row">
          <div className="col-md-2 pr-1">{this.props.LeftMenu}</div>

          <div className="col-md-10 ">
            <div className="row">
              <div className="col-md-12 pr-1">
                  {this.props.Body}

              </div>
            </div>{" "}
            <div className="row">
              <div className="col-md-9 pr-1">
                {" "}
                {/* <NewRegister /> */}
                {/* <Notification/> */}
                {/* <UploadDocuments /> */}
                {/* <Programs/> */}
                {/* <Profile/> */}
                {/* <ChangePassword/> */}
                {/* <OpenProgram/> */}
                {/* <EditProgram programId={this.state.programId}/> */}
                {/* <Dashboard/> */}
                {this.currentPage}
              </div>
              <div className="col-md-3 pr-1">
                  {/* {this.props.right} */}
                  </div>
            </div>
            <div className="row">
              <div className="col-md-12 pr-1"><Footer/></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
